    "2013-03-14T19:47:30.171874",nt"name": "digital-elevation-model-dem-24k",nt"isopen":
    false,nt"url": null,nt"notes": "Digital Elevation Model (DEM) is the terminology
    adopted by the USGS to describe terrain elevation data sets in a digital raster
    form. The standard DEM consists of a regular array of elevations cast on a designated
    coordinate projection system. The DEM data are stored as a series of profiles in
    which the spacing of the elevations along and between each profile is in regular
    whole number intervals. The normal orientation of data is by columns and rows. Each
    column contains a series of elevations ordered from south to north with the order
    of the columns from west to east. The DEM is formatted as one ASCII header record
    (A- record), followed by a series of profile records (B- records) each of which
    include a short B-record header followed by a series of ASCII integer elevations
    per each profile. The last physical record of the DEM is an accuracy record (C-record).
    7.5-minute DEM (30- by 30-m data spacing, cast on Universal Transverse Mercator
    (UTM) projection). Provides coverage in 7.5- by 7.5-minute blocks. Each product
    provides the same coverage as a standard USGS 7.5-minute quadrangle without over
    edge. Coverage is for the Contiguous United States, Hawaii, and Puerto Rico.",nt"license_title":
